/**
* Gets Institution data from legit Peoplesoft Tables
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_Institution
   method CCTC_Institution();

   method getInstitutionDetails(&bindVars As array of any) Returns array of array of any;

   method getGradingBasis(&bindVars As array of any) Returns array of array of any;
end-class;

method CCTC_Institution
   rem do nothing;
end-method;


/**
* This function provides an interface to the College Adaptor to 
* retrieve the Institutional details associated with a given instutition code
* 
* @param &bindVars[1]: institution code
* @Returns 2d array with a row per institution
*/
method getInstitutionDetails
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 element when getting institution details";
   End-If;

   If None(&bindVars [1]) Then
      Error "institution is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_INSTITUTION_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

